#Importation des bibliothèques
import pennylane as qml
from pennylane import numpy as np
import matplotlib.pyplot as plt
import pandas as pd
from sklearn.model_selection import train_test_split

# Création des données d'exemple (samples)
# en génèrant un tableau de 100 valeurs aléatoires comprises entre 0 et 1.
X = np.random.random(100, requires_grad=False)
Y = X + np.random.random(100, requires_grad=False)/10
#Y = aX+b
# OU charger vos propores données
'''data = pd.read_csv('file.csv')
X = data['X'].values
Y = data['Y'].values'''

# Normalisation de données
# en mettant les données à l'échelle dans une plage commune, généralement entre 0 et 1 pour améliorer la convergence des algorithmes
X_normalized = (X - np.min(X)) / (np.max(X) - np.min(X))
Y_normalized = (Y - np.min(Y)) / (np.max(Y) - np.min(Y))

# Répartition de données en deux ensembles : un ensemble d'entraînement (80% de données) et un ensemble de test (20%)
X_train, X_test, Y_train, Y_test = train_test_split(X_normalized, Y_normalized, test_size=0.2, random_state=42)

# Création du dispositif quantique
# qml.device : Cette fonction crée un simulateur quantique sur lequel le circuit quantique sera exécuté.
# 'default.qubit' : C'est le simulateur classique de qubit fourni par PennyLane.
# wires=1 : Indique que le circuit utilise un seul qubit (ou "fil").
dev = qml.device('default.qubit', wires=1)

# Define the quantum circuit
@qml.qnode(dev) # Cette annotation indique que la fonction suivante est un Quantum Node (qnode) qui sera exécuté sur le dispositif quantique dev.
def quantum_circuit(datapoint, params): # (x0, (a0,b0))
  #Cette fonction définit un circuit quantique qui prend deux entrées :
  #datapoint : Le point de données d'entrée qui est encodé dans le qubit.
  #params : Les paramètres du circuit quantique, qui contrôlent les rotations appliquées sur le qubit. ICI params représentent les paramètres d'apprentissage
    qml.RX(datapoint, wires=0) # Applique une rotation sur l'axe X du qubit en fonction de la valeur du datapoint.
    qml.Rot(params[0], params[1], params[2], wires=0) #Applique trois rotations successives au qubit sur les axes Z, Y, et Z, contrôlées par les paramètres params.
    return qml.expval(qml.PauliZ(wires=0)) # Retourne la valeur d'espérance (ou moyenne) de l'opérateur Pauli-Z, qui mesure l'état du qubit le long de l'axe Z. C'est cette valeur qui est utilisée comme prédiction du modèle.

"""Les deux opérations, **qml.RX(datapoint, wires=0) **et q**ml.Rot(params[0], params[1], params[2], wires=0)**, sont **des gates de rotation quantique** qui manipulent l'état du qubit en fonction des données (datapoint) et des paramètres du modèle (params). Voici pourquoi ces opérations sont utilisées dans le circuit quantique :

**qml.RX(datapoint, wires=0) : Rotation autour de l'axe X en fonction des données**
Cette opération est utilisée pour encoder les données classiques dans le qubit. Dans un modèle d'apprentissage machine quantique, il est nécessaire de traduire les données d'entrée classiques (les points de données) dans un état quantique afin que le circuit puisse les traiter.

RX est une porte quantique qui applique une rotation autour de l'axe X (couramment utilisé dans les circuits quantiques pour encoder l'information) de la sphère de Bloch (la représentation visuelle d'un qubit) où le datapoint est utilisé comme angle de rotation, ce qui signifie que la rotation appliquée au qubit dépend directement de la valeur du point de données d'entrée.

**qml.Rot(params[0], params[1], params[2], wires=0) : Rotations successives autour des axes Z, Y, Z**
Cette opération applique trois rotations successives sur les trois axes (Z, Y, Z) en fonction de trois angles de rotation params[0], params[1], et params[2]pour pouvoir manipuler complètement l'état d'un qubit sur la sphère de Bloch.
Les paramètres params contrôlent ces rotations et sont optimisés pendant l'entraînement pour minimiser la fonction de coût (c'est-à-dire améliorer la précision des prédictions).

En effet, la sphère de Bloch est une représentation visuelle de l'état d'un qubit qui peut être décrit comme un vecteur pointant vers une direction spécifique sur cette sphère, et ce vecteur peut être manipulé en appliquant des rotations autour des différents axes (X, Y, Z). La position du qubit sur la sphère est déterminée par deux angles :
θ (thêta) : L'angle polaire, qui indique la rotation du vecteur par rapport à l'axe Z.
φ (phi) : L'angle azimutal, qui indique la rotation du vecteur autour de l'axe Z.![Image1.png](data:image/png;base64,)

**Combinaison Z, Y, Z pour une manipulation complète**

En combinant des rotations autour des axes Z, Y, et de nouveau Z, il est possible de contrôler à la fois l'angle polaire (θ) et l'angle azimutal (φ) de manière indépendante. Cela permet de positionner le qubit à n'importe quel endroit sur la sphère de Bloch


1.   Première rotation sur Z : Modifie l'angle azimutal φ.

1.   Rotation sur Y : Modifie l'angle polaire θ, c'est-à-dire qu'elle déplace le qubit vers ou loin de l'axe Z.
2.   Deuxième rotation sur Z : Ajuste à nouveau l'angle azimutal φ après le changement de l'angle polaire.

Cette combinaison permet donc d'exploiter pleinement la sphère de Bloch, offrant une flexibilité maximale pour ajuster l'état du qubit dans un espace à deux dimensions complexe.
"""

#Pauli-Z

"""**qml.expval : Cela calcule l'espérance (ou valeur moyenne) d'une mesure sur le qubit. **

Dans ce cas, la mesure est faite en utilisant l'opérateur de Pauli-Z. En effet, PauliZ(wires=0) mesure l'état du qubit (mis dans le fil 0) dans la base Z (c'est-à-dire, la base computational, où les résultats possibles sont soit |0⟩ soit |1⟩).

L'espérance de Pauli-Z correspond à la probabilité d'obtenir |0⟩ (avec une valeur de 1) ou |1⟩ (avec une valeur de -1). Si l'état du qubit est parfaitement aligné avec l'axe Z (soit |0⟩), la mesure retournera +1, et si c'est parfaitement aligné dans l'autre direction (soit |1⟩), elle retournera -1. Si l'état est en superposition, le résultat sera une valeur comprise entre -1 et +1.

Par exemple, une mesure proche de +1 pourrait indiquer que le point de données appartient à la **classe 0**, tandis qu'une mesure proche de -1 pourrait indiquer la **classe 1**. Si plusieurs qubits étaient utilisés, ces résultats seraient combinés pour déterminer à quelle classe le point de données appartient.
"""

# Calcul de la perte (erreur) entre les prédictions générées par le modèle et les valeurs cibles targets
def loss_func(predictions, targets):
    return np.mean(np.array([(predictions[i] - targets[i]) ** 2 for i in range(len(targets))]))#np.mean((predictions - targets) ** 2)
#Moyenne des erreurs quadratiques : La perte est calculée en prenant la différence entre chaque prédiction et chaque valeur cible, en l'élevant au carré,
#puis en calculant la moyenne de ces écarts (erreur quadratique moyenne ou MSE).

# La fonction coût
def cost_fn(params, X, Y): #Cette fonction calcule le coût total (ou erreur totale) pour un ensemble de données d'entraînement X et les valeurs cibles correspondantes Y
    predictions = [quantum_circuit(x, params) for x in X] #Elle génère d'abord les prédictions pour chaque point de données x dans X.
    return loss_func(predictions, Y) # Elle retourne l'erreur globale, qui sera utilisé par l'optimiseur pour ajuster les paramètres params

# Définiton de l'Optimizer
opt = qml.GradientDescentOptimizer(stepsize=0.3)
# C'est un optimiseur classique basé sur la descente de gradient qui va ajuster les paramètres du circuit quantique pour minimiser la fonction de coût
# stepsize est le pas d'apprentissage, qui contrôle la rapidité avec laquelle les paramètres changent à chaque itération de l'optimisation.

# Initialisation des paramètres
params = np.array([0.1, 0.1, 0.1], requires_grad=True)
#requires_grad=True : Cela signifie que les paramètres sont différentiables, et peuvent donc être modifiés lors de l'optimisation via la descente de gradient.

# La phase d'entraînement
for i in range(100): #Cette boucle effectue 100 étapes d'entraînement pour ajuster les paramètres du circuit quantique
    params, prev_cost = opt.step_and_cost(lambda p: cost_fn(p, X_train, Y_train), params) # Cette méthode réalise une étape de descente de gradient pour mettre à jour les paramètres params
    #lambda p: cost_fn(p, X_train, Y_train) : Fonction anonyme qui passe les paramètres à la fonction de coût pour les ensembles de données d'entraînement X_train et Y_train.
    if i % 10 == 0:
        print(f'Step {i}, Cost {prev_cost}') #Affichage périodique du coût actuel pour toutes les 10 étapes

# Génération des prédictions
test_predictions = [quantum_circuit(x, params) for x in X_test] #n exécutant le circuit quantique pour chaque point de données de test

# Affichage des résultats
plt.scatter(X_train, Y_train, color='blue', label='Training Data')
plt.scatter(X_test, Y_test, color='red', label='Test Data')
plt.scatter(X_test, test_predictions, color='green', label='Predictions', marker='x')
plt.xlabel("Normalized X")
plt.ylabel("Normalized Y")
plt.title("Quantum Regression Model Results")
plt.legend()
plt.show()

